{% endset %}

{% do run_query(query) %}

{% endmacro %}

macro.dbt_gx_demo.log_dbt_results.macro_sql:
{% macro log_dbt_results(results) %}

    -- depends_on: {{ ref('failures') }}

    {%- if execute -%}
        {%- set parsed_results = parse_dbt_results(results) -%}
        {%- if parsed_results | length  > 0 -%}
            {% set insert_dbt_results_query -%}
                insert into {{ ref('failures') }}
                    (
                        result_id,
                        invocation_id,
                        unique_id,
                        database_name,
                        schema_name,
                        name,
                        resource_type,
                        status,
                        execution_time,
                        rows_affected,
                        error_message
                ) values
                    {%- for parsed_result_dict in parsed_results -%}
