            'not_null'],
        quote_columns=false) -%}
    {%- if execute and var('dbt_constraints_enabled', false) and results -%}
        {%- do log("Running dbt Constraints", info=true) -%}

        {%- set lookup_cache = {
            "table_columns": { },
            "table_privileges": { },
            "unique_keys": { },
            "not_null_col": { },
            "foreign_keys": { } } -%}

        {%- if 'not_null' in constraint_types -%}
