{%- macro bigquery__day_of_week(date, isoweek) -%}

    {%- set dow = dbt_date.date_part('dayofweek', date) -%}

    {%- if isoweek -%}
    case
        -- Shift start of week from Sunday (1) to Monday (2)
        when {{ dow }} = 1 then 7
        else {{ dow }} - 1
    end
    {%- else -%}
    {{ dow }}
    {%- endif -%}

{%- endmacro %}

macro.dbt_date.postgres__day_of_week.macro_sql:
{%- macro postgres__day_of_week(date, isoweek) -%}

    {%- if isoweek -%}
        {%- set dow_part = 'isodow' -%}
        -- Monday(1) to Sunday (7)
        cast({{ dbt_date.date_part(dow_part, date) }} as {{ dbt.type_int() }})
    {%- else -%}
        {%- set dow_part = 'dow' -%}
        -- Sunday(1) to Saturday (7)
        cast({{ dbt_date.date_part(dow_part, date) }} + 1 as {{ dbt.type_int() }})
    {%- endif -%}

{%- endmacro %}

macro.dbt_date.redshift__day_of_week.macro_sql:
{%- macro redshift__day_of_week(date, isoweek) -%}

    {%- set dow = dbt_date.date_part('dayofweek', date) -%}

    {%- if isoweek -%}
    case
        -- Shift start of week from Sunday (0) to Monday (1)
        when {{ dow }} = 0 then 7
        else cast({{ dow }} as {{ dbt.type_bigint() }})
    end
    {%- else -%}
    cast({{ dow }} + 1 as {{ dbt.type_bigint() }})
    {%- endif -%}

{%- endmacro %}

macro.dbt_date.n_weeks_away.macro_sql:
{%- macro n_weeks_away(n, tz=None) -%}
{%- set n = n|int -%}
{{ dbt.date_trunc('week',
    dbt.dateadd('week', n,
        dbt_date.today(tz)
        )
    ) }}
{%- endmacro -%}

macro.dbt_date.tomorrow.macro_sql:
{%- macro tomorrow(date=None, tz=None) -%}
{{ dbt_date.n_days_away(1, date, tz) }}
{%- endmacro -%}

macro.dbt_date.week_start.macro_sql:
{%- macro week_start(date=None, tz=None) -%}
{%-set dt = date if date else dbt_date.today(tz) -%}
{{ adapter.dispatch('week_start', 'dbt_date') (dt) }}
{%- endmacro -%}

macro.dbt_date.default__week_start.macro_sql:
{%- macro default__week_start(date) -%}
cast({{ dbt.date_trunc('week', date) }} as date)
{%- endmacro %}

macro.dbt_date.snowflake__week_start.macro_sql:
{%- macro snowflake__week_start(date) -%}
    {#
        Get the day of week offset: e.g. if the date is a Sunday,
        dbt_date.day_of_week returns 1, so we subtract 1 to get a 0 offset
    #}
    {% set off_set = dbt_date.day_of_week(date, isoweek=False) ~ " - 1" %}
    cast({{ dbt.dateadd("day", "-1 * (" ~ off_set ~ ")", date) }} as date)
{%- endmacro %}

macro.dbt_date.postgres__week_start.macro_sql:
{%- macro postgres__week_start(date) -%}
-- Sunday as week start date
cast({{ dbt.dateadd('day', -1, dbt.date_trunc('week', dbt.dateadd('day', 1, date))) }} as date)
{%- endmacro %}

macro.dbt_date.today.macro_sql:
{%- macro today(tz=None) -%}
cast({{ dbt_date.now(tz) }} as date)
{%- endmacro -%}

macro.dbt_date.get_fiscal_year_dates.macro_sql:
{% macro get_fiscal_year_dates(dates, year_end_month=12, week_start_day=1, shift_year=1) %}
{{ adapter.dispatch('get_fiscal_year_dates', 'dbt_date') (dates, year_end_month, week_start_day, shift_year) }}
{% endmacro %}
